[gcode_macro HomeAll]
gcode:
  G28 X
  G1 X295 F1200
  G4 P500

  G28 Y
  G1 Y295 F1200
  G4 P500
  
  G0 X150 Y150 F6000
  G28 Z 
  CENTER

[gcode_macro HomeAll_Tilt]
gcode:
  HomeAll
  CENTER
  Fast_Tilt


[gcode_macro CHOME]
description: Homes XYZ axis only if printer is in a non-homed state
gcode:
  {% if "xyz" not in printer.toolhead.homed_axes %}
    G28
  {% endif %}
    

[idle_timeout]
timeout: 1800

